      "snippet": {
        "publishedAt": "2022-01-22T22:51:04Z",
        "channelId": "UCJ2kTrVhAy9MP5hepSn0vww",
        "title": "￼ Carlos Núñez en el teatro circo Price el 22 de enero de 2022￼",
        "description": "Concierto en Madrid de Carlos Núñez para celebrar los 25 años de su disco Irmandade das estrelas donde contó con Rozalén, con John Pitzalski, con Itsaso Berra, con una arpista bretona, con banda de gaitas de Alcalá de Henares, de Carabanchel, y del centro Gallego de Madrid.\nPresentó las nuevas canciones de su disco celebración de este 25 aniversario como por ejemplo el ramo verde donde contó con Diana Caloto.\nTodo el concierto fue un homeneje a Paddy Moloney que falleció el 6 de marzo de 2019a los 75 años y fue un músico irlandés de étnica gaélica, reconocido internacionalmente por su trabajo en el grupo The Chieftains.\n\nPaddy Moloney nació el 6 de marzo de 1944 en el pueblo de Drimnagh, al sur de Dublín. A los seis años comenzó a tocar la flauta en la escuela y a los nueve formó su propio grupo, The Drimnagh Folk Band. A los dieciséis años se unió a The Chieftains, que en ese momento estaba integrado por siete músicos.\n\nThe Chieftains se convirtió en una de las agrupaciones más respetadas a nivel internacional, gracias a su mezcla de estilos irlandeses tradicionales con música clásica, folk y pop. Durante su carrera, el grupo ha colaborado con artistas como Bono, The Edge, Sting, Elvis Costello, Barbra Streisand y Ricky Martin.\n\nPaddy Moloney fue reconocido con numerosos premios, entre ellos el Grammy, el Ivor Novello, el BBC Folk Music Award y el Irish Times Traditional Musician of the Year.\n\nEl 6 de marzo de 2019, a los 75 años, Paddy Moloney falleció víctima de un cáncer.\n\nThis year Carlos Nuñez celebrates his 25th anniversary of the release of the album A Irmandade da Estrela with artists such as Paddy Molowny from The Chieftains, Davy Spillane from Moving Hearts, and Lenny White from Return to Forever.\n\nCarlos Núñez was born in Galicia, Spain, into a family of musicians. His father, Xosé Manuel Núñez, is a well-known Galician bagpiper, and his mother, Maruxa, a singer. His older brother, Xurxo, is a multi-instrumentalist who has collaborated with Carlos on many of his recordings.\n\nNúñez began his musical training on the bagpipes and the guitarbut he soon added the flute, the mandolin, and the bouzouki to his repertoire. He also developed a strong interest in traditional Irish and Scottish music, and in the early 1990s he began to tour extensively with The Chieftains.\n\nNúñez's solo career took off in 1995 with the release of the album A Irmandade da Estrela. The album was a collaboration with some of the leading figures in the Irish and Scottish music scenes, including Paddy Molowny from The Chieftains, Davy Spillane from Moving Hearts, and Lenny White from Return to Forever.\n\nA Irmandade da Estrela was a critical and commercial success, and it helped to introduce Núñez's music to a wider audience. Over the years he has released a number of other solo albums, including O Son Do Ar (1998), Os Amores Libres (2002), and O País Dos Balcáns (2008).\n\nNúñez has also collaborated extensively with other artists, including The Chieftains, Ry Cooder, The Dubliners, The Waterboys, and Emmylou Harris. In 2013 he was awarded a Grammy for his work on the album Celtic Thunder – Heritage.\n\nTo celebrate the 25th anniversary of the release of A Irmandade da Estrela, Núñez is embarking on a world tour with some of the artists who contributed to the album, including Paddy Molowny, Davy Spillane, and Lenny White. The tour will visit North America, Europe, and Asia, and it will culminate with a performance at the Celtic Connections festival in Glasgow, Scotland.",
